import React from 'react'
import { Navigate } from 'react-router-dom';

const PrivateRoute = ({children}) => {
    const token = window.localStorage.getItem('token');
    if(token){
      return children;
    }else{
      return <Navigate to="/signin" />
    }
  }

export default PrivateRoute;
